import logo from './logo.svg';
import './App.css';

// ECMA6 function formatting
const NavigationBar = () => {
  return (
    <header>
    <nav>
      <ul>
        <li> Home </li>
        <li> Profile </li>
      </ul>
    </nav>
  </header>
  )
}

function App() {
  return (
    <div className="App">
      <NavigationBar />
    </div>
  );
}

export default App;
